import React from "react";
import classes from "./Contact.module.css";
import Navbar from "../CommonCompnents/Navbar";
import Footer from "../CommonCompnents/Footer";
import { useRef, useState } from "react";
const Contact = () => {
  const nameto = useRef();
  const emailto = useRef();
  const [invalid, setInvalid] = useState(false);
  const formHandler = (event) => {
    event.preventDefault();
    console.log(nameto);
    if (nameto.current.value === "" && emailto.current.value === "") {
      nameto.current.attributes.placeholder.nodeValue = " Please Enter Data";
      emailto.current.attributes.placeholder.nodeValue =
        " Please Enter Your Email id:";
    }
    if (nameto.current.value === "") {
      nameto.current.style.border = "1px solid red";
      nameto.current.attributes.placeholder.nodeValue = " Please Enter Data";
    }
    if (emailto.current.value === "") {
      console.log(emailto.current.style.focus);
      emailto.current.style.border = "1px solid red";
      emailto.current.attributes.placeholder.nodeValue =
        " Please Enter Your Email id:";
    }
    if (
      !emailto.current.value.includes("@") &&
      !emailto.current.value.length < 6
    ) {
      emailto.current.style.border = "1px solid red";
      console.log(emailto.current.value.length);
      setInvalid(true);
    }
    if (
      emailto.current.value.includes("@") &&
      emailto.current.value.length > 6
    ) {
      emailto.current.style.border = "";
      setInvalid(false);
      console.log("hello");
    }
  };
  return (
    <React.Fragment>
      <Navbar />
      <div className={classes.head}>
        <h1>Contact US</h1>
        <h3>
          Any questions or remarks?
          <br /> Just drop us a message!
        </h3>
        <img src="/assets/Line 6.png"></img>
      </div>
      <div className={classes.container}>
        <div className={classes.right}>
          <div className={classes.data}>
            <form onSubmit={formHandler} />
            <div>
              <h2>
                First Name{" "}
                <span>
                  <img src="/assets/Vector (5).png" />
                </span>
                ref={nameto}
              </h2>
              <input type="text" />
            </div>
            <div>
              <h2>Last Name</h2>
              <input type="text" />
            </div>
            <div>
              <h2>
                Email{" "}
                <span>
                  <img src="/assets/Vector (5).png" />
                </span>
                ref={emailto}
              </h2>
              <input type="text" />
            </div>
            <div>
              <h2>
                Mobile{" "}
                <span>
                  <img src="/assets/Vector (5).png" />
                </span>
              </h2>
              <input type="text" />
            </div>
          </div>
          <div className={classes.type}>
            <h1>What type of services you want? Select below.</h1>
            <div className={classes.radio}>
              <div>
                <input type="radio" />
                <h3>Product Development</h3>
              </div>
              <div>
                <input type="radio" />
                <h3>Operations Transformation</h3>
              </div>
              <div>
                <input type="radio" />
                <h3>Other Services </h3>
              </div>
              <div>
                <input type="radio" />
                <h3>Cloud Transformation</h3>
              </div>
              <div>
                <input type="radio" />
                <h3>Analytics</h3>
              </div>
            </div>
            <h2>
              All fields marked with an asterisk (
              <span>
                <img src="/assets/Vector (5).png" />
              </span>
              ) are mandatory.
            </h2>
            <div className={classes.meg}>
              <h1>Message </h1>
              <input type="text" placeholder="Write your message..." />
              <div className={classes.l}>
                <input type="checkbox" />
                <h3>I agree to the Privacy Policy and Other T&C.</h3>
              </div>
              <button>Send Message</button>
            </div>
          </div>
        </div>

        <div className={classes.abox}>
          <h3>How to Find Us!</h3>
          <h4>
            Fill up the form if you have any questions, and our team will get
            back to you within 24 hours.
          </h4>
          <div>
            <img src="/assets/Rectangle 18.png"></img>
            <h3>info@oaknst.com</h3>
          </div>
          <div>
            <img src="/assets/Vector (4).png"></img>
            <h3>
              Gurgaon, Sec-53, Golf
              <br /> Course Road
            </h3>
          </div>
          <div>
            <img src="/assets/linkedin" />
          </div>
          <img src="/assets/Pattern1.png" />
        </div>
      </div>
      <Footer />
    </React.Fragment>
  );
};
export default Contact;
